import React from 'react';
import { useSelector } from 'react-redux';

function Provinsi(props) {  
    const tableData= useSelector((store)=> store.covid.covid);
    const {index} = props
    return (
            <tr key={tableData.kota}>
                <td>{index + 1}</td>
                    <td>{tableData.kota}</td>
                        <td>{tableData.kasus}</td>
                        <td>{tableData.sembuh}</td>
                        <td>{tableData.meninggal}</td>
                        <td>{tableData.dirawat}</td>
                </tr>

    );
}

export default Provinsi;
